  [],\n\t\"revision_timestamp\": \"2016-07-27T22:47:00.026619\",\n\t\"name\": \"narrative-report-1970-lostwood-national-wildlife-refuge\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Lostwood
  National Wildlife Refuge outlines Refuge accomplishments during the 1970 calendar
  year. The report begins by summarizing the weather conditions, habitat conditions,
  water conditions, and food and cover conditions during the year. Wildlife- including
  migratory birds, upland game birds, big game animals, furbearers, predators, rodents,
  raptors, and reptiles- is also covered. The Refuge development and maintenance section
  discusses physical developments and vegetation control. Resource management is outlined;
  topics include grazing. A progress report on field investigations and applied research
  is also provided. The public relations section of the report describes recreational
  uses, Refuge visitors, Refuge participation, hunting, violations, and safety. N-R
  forms, and photographs are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
